item.solution:
program decode;
var s1,s2:array[1..200000] of char;
    i,fromv,endv,n,m,l,k:longint;

procedure shleft(k:longint);
begin
 fromv:=(fromv+k) mod n;
 if fromv=0 then fromv:=n;
 endv:=(endv+k) mod n;
 if endv=0 then endv:=n;
end;

procedure nxor;
var t,i:longint;
begin
t:=(endv-m+1+n) mod n;
if t=0 then t:=n;
if endv>t then
  for i:=t to endv do
   if s1[i-t+1]<>s2[i] then s2[i]:='1'
   else s2[i]:='0';
if endv<t then
 begin
  for i:=t to n do
   if s1[i-t+1]<>s2[i] then s2[i]:='1'
   else s2[i]:='0';
  for i:=1 to endv do
   if s1[i+n-t+1]<>s2[i] then s2[i]:='1'
   else s2[i]:='0';
  end;
end;

procedure nout;
var i:longint;
begin
 if fromv<endv then
   for i:=fromv to endv do
    write(s2[i]);
 if fromv>endv then
  begin
   for i:=fromv to n do
   write(s2[i]);
   for i:=1 to endv do
    write(s2[i]);
  end;
end;


begin
//assign(input,'decode.in');
//assign(output,'decode.out');
//reset(input);
//rewrite(output);
readln(n,m,l,k);
for i:=1 to m do
 read(s1[i]);
readln;
for i:=1 to n do
read(s2[i]);
fromv:=1;
endv:=n;
for i:=1 to k do
 begin
  shleft(l);
  nxor;
 end;
nout;
//close(input);
//close(output);
end.
